import React from "react";

import "./Footer.css";
function Footer() {
  return (
    <div className="nav-footer">
      <div>
        <p>Adresse: 10 quai de la charente, 75019 Paris 19</p>
      </div>
      <div>
        <p>Téléphone : 01 23 45 67 89</p>
      </div>
      <div>
        <p>Email : support@name.com</p>
      </div>
    </div>
  );
}

export default Footer;
